import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

function Hello (props){
  return <h3>{props.title}</h3>
}

const Hello2 = (props)=><h4>{props.title}</h4>

class Hello3 extends Component {
  render(){
    return <h5>{this.props.title}</h5>
  }
}

class Text extends Component {
  render(){
    return (
    <div>
      <p>{this.props.text}</p>
      <p>{this.props.number}</p>
      <p>{JSON.stringify(this.props.boolean)}</p>
    </div>
    )
  }
}


function App() {
  return (
    <div className="App">
      <header className="App-header">
      <p>Bienvenidos a React</p>
        <img src={logo} className="App-logo" alt="logo" />

        <Hello title="Hello from props"/>

        <Hello2 title="Hello from props 2"/>

        <Hello3 title="Hello from props 3"/>

        <Text number={3} boolean={true} text="Hola que tal"/> 


      </header>
    </div>
  );
}

export default App;
